import React from "react";
import { Link, Navigate } from "react-router-dom";

<nav>
  <Link to="/signin"></Link>
</nav>;

const PrivateRoute = ({ user, children }) => {
  const { name } = user;
  console.log(name);
  if (!name) {
    return <Navigate replace to="/signin" />;
  }

  return children;
};

export default PrivateRoute;
